import React, { useState, useEffect, useRef } from "react";
import "./Canvas.css";
import { Link, Outlet } from "react-router-dom";
import canva from "../Sections/canva.png";
import profile from "../Sections/profile.png";
import dashboard from "../Sections/dashboard.png";
import search from "../Sections/search.png";
import calendar from "../Sections/calendar.png";
import inbox from "../Sections/inbox.png";
import history from "../Sections/history.png";
import help from "../Sections/help.png";

export const Canvas = () => {
  const [showAccount, setShowAccount] = useState(false);
  const accountRef = useRef(null);

  // Close account panel if user clicks outside of it
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (accountRef.current && !accountRef.current.contains(event.target)) {
        setShowAccount(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, []);

  return (
    <div style={{ display: "flex", position: "relative" }}>
      {/* Sidebar */}
      <div className="canvas-sidebar">
        <div className="sidebar-logo">
          <Link to="/">
            <img src={canva} alt="Canvas Logo" />
          </Link>
        </div>

        {/* ACCOUNT button */}
        <div
          className="sidebar-item"
          onClick={() => setShowAccount(!showAccount)}
          style={{ cursor: "pointer" }}
        >
          <img src={profile} alt="Account" />
          <span>Account</span>
        </div>

        <div className="sidebar-item">
          <img src={dashboard} alt="" />
          <Link to="dashboard">Dashboard</Link>
        </div>
        <div className="sidebar-item">
          <img src={search} alt="" />
          <Link to="modules">Modules</Link>
        </div>
        <div className="sidebar-item">
          <img src={calendar} alt="" />
          <Link to="calendar">Calendar</Link>
        </div>
        <div className="sidebar-item">
          <img src={inbox} alt="" />
          <Link to="inbox">Inbox</Link>
        </div>
        <div className="sidebar-item">
          <img src={history} alt="" />
          <Link to="history">History</Link>
        </div>
        <div className="sidebar-item">
          <img src={help} alt="" />
          <Link to="help">Help</Link>
        </div>
      </div>

      {/* Floating Account Panel */}
      <div
        ref={accountRef}
        className={`account-panel ${showAccount ? "show" : ""}`}
      >
        <div className="account-header">
          <div className="account-avatar">DJ</div>
          <div className="account-name">Dionisio, John Carlo</div>
          <button className="logout-btn">Logout</button>
        </div>

        <ul className="account-links">
          <li>Notification</li>
          <li>Profile</li>
          <li>Files</li>
          <li>Settings</li>
          <li>ePortfolios</li>
          <li>QR for Mobile Login</li>
          <li>Global Announcements</li>
        </ul>

        <div className="account-options">
          <label>
            <input type="checkbox" /> Use High Contrast UI
          </label>
          <label>
            <input type="checkbox" /> Use a Dyslexia Friendly Font
          </label>
        </div>
      </div>

      {/* Main Page */}
      <div style={{ flex: 1, padding: "20px" }}>
        <Outlet />
      </div>
    </div>
  );
};
